import React, { useEffect, useState } from "react";

const App = () =>{

  const [num, setnum] = useState(0);
  const [nums, setnums] = useState(0);
  useEffect(()=>{
    //alert('I am clicked');
    document.title='you clicked me ${num} times';
  },[num])
  return(
    <>
    <button onClick={() =>{
      setnum(num+1)
    }}>click me {num}</button><br />
     <button onClick={() =>{
      setnums(nums+1)
    }}>click me {nums}</button>
    </>
  );
};
export default App;
